import PhotoCardsView from './PhotoCards-view'
import React from 'react'


const PhotoCards = ({ photos, owner, updateData }) => {
    return <div className="columns is-gapless is-multiline is-mobile">
        {photos.map(photo => {
            console.log([...photos, { ...photo, active: !photo.active }])
            return <PhotoCardsView onClick={() => updateData([...photos, { ...photo, active: !photo.active }], 'PHOTOS')}
                {...photo} owner={owner} />
        })}
    </div>

}



export default PhotoCards
